import React from "react";
import styled from "styled-components";

const MapContainer = styled.div`
  position: relative;
  width: 100%;
  height: 1500px;
  margin-bottom: 50px;
`;

function Main() {
  return (
    <>
      <MapContainer>
        <script
          type="text/javascript"
          src="http://dapi.kakao.com/v2/maps/sdk.js?appkey=a9cb6f1eaea0879aee7e0eaff3eb864b"
        ></script>
      </MapContainer>
    </>
  );
}
export default Main;
